import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, ZoomControl } from "react-leaflet";
import { PageContainer, Title } from "./styles/solution_style.js";

function Solution() {
  const API_KEY = "e6d8c9c20269bd6d193a610ab4f7d761";
  const city = "London";
  const url = `https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=${API_KEY}`;

  fetch(url)
    .then((response) => response.json())
    .then((data) => console.log(data))
    .catch((error) => console.error(error));
  return (
    <PageContainer>
      <MapContainer
        center={[39.1, -76.1]}
        zoom={10}
        scrollWheelZoom={true}
        zoomControl={false}
      >
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a>'
        />
        <TileLayer
          url={`https://tile.openweathermap.org/map/precipitation_new/{z}/{x}/{y}.png?appid=e6d8c9c20269bd6d193a610ab4f7d761`}
        />
        <ZoomControl position="topright" />
      </MapContainer>
    </PageContainer>
  );
}
